import React, {Component} from 'react';
import Contact from './Contact';

class ContactsList extends Component {

    




    render() {

        return (
            <div>


                <ul>
                    {filteredContacts.map((contact)=>{
                        return <Contact contact={contact} key={contact.id}/>
                    })}
                </ul>
            </div>
        );
    }
}

export default ContactsList;
